description:
All other property that is not in Class 1 and is primarily residential (rentals, cooperatives and condominiums). Class 2 includes:
Sub-Class 2a  (4 -  6 unit rental building);
Sub-Class 2b  (7 - 10 unit rental building);
Sub-Class 2c  (2 - 10 unit cooperative or condominium); and
Class 2  (11 units or more).

?	S2S AM - stop to school service, sometimes referred to as 'general education', routed for the trip 'to' school in the morning; 
?	S2S PM - stop to school service, sometimes referred to as 'general education', routed for the trip 'from' school in the afternoon; 
?	D2D ? curb-to-curb service, sometimes referred to as ?special education busing' or ?door-to-door? service.

Type of Activity for this approved permit.

Load in/out ? vehicles parking to load sets, equipment, etc. into location;

Shooting ? filming scheduled to occur;

DCAS Prep/Shoot/Wrap ?activity scheduled to occur on Department of Citywide Administrative Services (DCAS) property, such as a city courthouse;

Rigging ? set dressing activity at location, not filming yet
